css:
.deprecation-cop {
  overflow: auto;
  -webkit-flex: 1;
  background-color: #2a1a03 !important;
}
.deprecation-cop .deprecation-info {
  padding: 0 8px;
}
.deprecation-cop .deprecation-info:hover {
  background-color: #06675b !important;
}
.deprecation-cop .collapsed > ul {
  display: none;
}
.deprecation-cop .list {
  list-style-type: none;
  padding: 0;
}
.deprecation-cop .stack-trace {
  background-color: #322107;
  padding: 8px;
  margin-bottom: 8px;
}
.deprecation-cop a {
  color: #f3e0c4;
}
